Deluxe Rooms offer stylish comfort with the luxury of space. The rooms feature an inviting earth-tone design that is based on warm sycamore veneers. In addition, these rooms are decorated with original local artwork and feature views of thei cityscape. This Deluxe Suite is our signature room and perfect for that romantic escape. While the best way to experience our hotel with your family is to spread out in one of our two or three bedroom deluxe suites. They offer all of the amenities of our deluxe suite plus the additional bedrooms to accommodate your family in comfort.Beyond the traditional concept of rest and relaxation, we have created a journey of serenity revolved around two people in love.

Our Double rooms (for 2 people) are air conditioned and have a full bed (from 140cm to 160cm), a flat screen TV, free WiFi, a safe and a private bathroom (bathtub or shower) with complimentary toiletries and a hair dryer. These rooms all have an office area and are non-smoking.

